window.bookSummaryJSON = "<p>Maxwell Morgan has always been a very practical guy. He started working at age 15 because his foster family was stretched thin. He joined the army right out of high school to earn money for college. Even after getting his first job after college, he kept working the three jobs that let him get there—National Guard infantryman, farmer, and blacksmith. </p> <p>About nine months into his new job as an HR generalist, Max’s boss arranged a one-week team-building event for the team. Max and his five attractive female coworkers boarded the plane for Sheridan, Wyoming, and then things went sideways.</p> <p>Suddenly, they were going…somewhere else. What's a practical guy to do?</p>"; 
